import React, { useState, useEffect } from 'react';
import axios from 'axios';

function DangKyXe() {
  const [xeList, setXeList] = useState([]);

  useEffect(() => {
    const fetchData = async () => {
      try {
        const response = await axios.get('http://localhost:5000/api/xe');
        setXeList(response.data);
      } catch (error) {
        console.error("Lỗi khi tải danh sách xe:", error);
      }
    };
    fetchData();
  }, []);

  return (
    <div>
      <h2 className="content-header">Danh sách Đăng ký xe</h2>
      <table className="data-table">
        <thead>
          <tr>
            <th>Biển Số</th>
            <th>CCCD Chủ Xe</th>
            <th>Hãng Xe</th>
            <th>Loại Xe</th>
            <th>Ngày Đăng Ký</th>
          </tr>
        </thead>
        <tbody>
          {xeList.map((xe) => (
            <tr key={xe.so_dang_ky_xe}>
              <td>{xe.bien_so}</td>
              <td>{xe.so_cccd_chu_xe}</td>
              <td>{xe.hang_xe}</td>
              <td>{xe.loai_xe}</td>
              <td>{new Date(xe.ngay_dang_ky).toLocaleDateString()}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}

export default DangKyXe;
